import React from 'react';
import {ControlledEditor} from '@monaco-editor/react';

const MonacoEditorComponent = ({language, value, onChange}) => {
    return (
        <ControlledEditor
            height="90vh"
            language={language}
            value={value}
            onChange={onChange}
        />
    );
};

export default MonacoEditorComponent;
